import React from 'react';
import './Posts.css';
import Post from '../Post.js'
import data from '../../data.js';

const Posts = () => {
    return (
        <div className="posts">
            {data.map((item) => {
                <Post />
            })}
        </div>
    )
}

export default Posts;
